    - ! 'Mr Adi Godrej : Chairman, Godrej Group'
    - ! "<p><b>Adi Godrej</b> is Chairman of The Godrej Group, an over 100 year-old
      family conglomerate, with operations in India and many other countriesMr. Godrej
      earned a bachelor’s and a master’s degree from the Sloan School of Management
      at MIT.</p> \r\n\r\n<p>He is the President of the Confederation of Indian Industry
      (CII) and Chairman of the Board of the Indian School of Business. Mr. Godrej
      has been the president of several Indian Trade and Industrial Bodies and associations.</p>\r\n
      <p>He has been a member of the Dean’s Advisory Council of the MIT Sloan School
      of Management, Chairman of the Board of Governors of the Narsee Monjee Institute
      of Management Studies and a member of the Wharton Asian Executive Board. Mr.
      Godrej is a patron of the Himalayan Club.</p>\r\n <p>He is a recipient of several
      awards and recognitions including the Rajiv Gandhi Award 2002, The American
      India Foundation (AIF) Leadership in Philanathropy Award, May 2010, The Entrepreneur
      of the Year for the Asia Pacific Entrepreneurship Awards 2010, Best Businessman
      of the Year for the GQ Men of the Year Awards 2010, Chemexcil’s Life Time Achievement
      Award 2010, AIMA-JRD Tata Corporate Leadership Award 2010, BMA-Management Man
      of the Year Award 2010-2011 and Qimpro Platinum Standard award for business
      in 2011.</p>\r\n\r\n<span><b>SPEAKING AT:</b>\r\nISB and Family Business</span>"
    - AdiGodrej.jpg
    - image/jpeg
    - 7230
    - '2013-06-28 17:41:20.167525'
  - - 2
    - 96
    - 
    - ''
    - '2013-02-01 10:18:14.679599'
    - ! 'Mr Ajay G Piramal : Chairman, Piramal Group'
    - ! "<p><b>Mr. Ajay Piramal</b> leads the Piramal Group - a 2 bn. dollar conglomerate
      with a presence across 100 countries. An exceptional entrepreneur and innovator,
      he enabled the Piramal Group to evolve from a textile centric business to a
      diversified business with interests across pharmaceuticals, packaging, financial
      services and real estate. Besides heading the boards of Piramal group companies,
      Mr. Piramal is also the Chairman of the Board of Governors of Indian Institute
      of Technology, Indore. He is a Member of the Board of Dean’s Advisors of the
      Harvard Business School. He is also the Chairman of Pratham India, the largest
      NGO in education sector with a reach of 33 million children.</p>\r\n\r\n<p>In
      the past, Mr. Piramal has been a Member of Prime Minister’s Task Force on Pharmaceuticals
      & Knowledge-Based Industries and a member of PM’s Council for Trade & Industry.\r\n
      Mr. Piramal was a Member of the World Economic Forum’s Governors’ Forum on Healthcare
      and often addressed at WEF on various topics. He has served as a Member of Central
      Board of Directors of State Bank of India.\r\n  Mr. Piramal has also been a
      member of National Council of Confederation of Indian Industry (CII). He was
      the Chairman of the Drugs and Pharmaceutical Council of CII from 2004 to 2009.</p>\r\n\r\n\r\n\r\n<p>Mr.
      Piramal holds a Masters in Management Studies from Jamnalal Bajaj Institute
      of Management Studies and an Advanced Management Programme from Harvard Business
      School.\r\n<p>\r\n\r\n\r\n<p>Mr. Piramal was accorded the “India Innovator of
      the Year 2008” Award by CNBC TV 18. He was given “Entrepreneur of the Year”
      Award of UK Trade & Investment Council (2006).\r\n He received Ernst & Young’s
      Entrepreneur of the Year award (2004) in the Healthcare & Life Sciences category.
      He was also presented “CEO of the Year Award” by World Strategy Forum in 1999.</p>\r\n\r\n\r\n<span><b>Speaking
      at:</b>\r\n\r\nFamily Entrepreneurship</span>"
