      ISB and Kellogg School.</p>\r\n\r\n<p>He has conducted workshops and lead case
      discussions on Family Business for organizations like Confederation of Indian
      Industries (CII), Young Presidents Organization Delhi, Bangalore and Nairobi
      (Kenya), All India Management Association (AIMA), Institute of Chartered Accountants
