      Foundation for Corporate Governance (NFCG) and Madras Management Association
      (MMA). He has also authored a book on family business, titled, “Triumph of Togetherness”
      Mr. Sainani has done his Masters from IIM Bangalore and holds a Diploma in Creative
      Writing in English and a Masters’ degree in Arts.</p>\r\n\r\n<span><b>Speaking
      at :</b> Building Institutions : Role of Family and Business Governance</span>"
