    - ! 'Prof. Arun Pereira : Clinical Associate Professor & Executive Director –
      Centre for Teaching, Learning and Case Development'
    - ! "<p><b>Professor Arun Pereira </b>is Clinical Associate Professor, and Executive
      Director, Centre for Teaching, Learning, and Case Development at ISB. Previously,
      he was Associate Professor of Marketing at the Cook School of Business, Saint
      Louis University, St. Louis, MO, USA (1991-2008). His recent teaching awards
      include: 2012 Professor of the Year (Elective Courses) at ISB, Best Teacher,
      Executive MBA (Class of 2004), and Best Teacher, Executive MBA (Class of 2005),
      at the Boeing Institute of International Business, Saint Louis University, St.
      Louis, MO.</p>\r\n\r\n<ul><li>Professor Pereira's research has appeared in various
      journals including, Journal of the Academy of Marketing Science, International
      Journal of Management Science, Journal of Business Research, Journal of Product
      and Brand Management, Psychology and Marketing, Journal of Retailing, Industrial
      Marketing Management, Journal of Business Ethics, and International Journal
      of Research in Marketing.</li>\r\n<li> His most recent book, co-authored with
