    - ! 'Mr. Dieter Spaelti : Managing Partner and CEO, Spectrum Value Management
      Ltd, Zurich '
    - ! "<p><b>Mr. Dieter Spaelti</b> is a Swiss national, born February 27, 1961.
      He studied law at the University of Zurich, obtaining a doctorate in 1989. He
      began his professional career as a credit officer with Bank of New York in New
      York, before taking up an appointment as CFO of Tyrolit (Swarovski group), based
      in Innsbruck and Zurich, in 1991.</p>\r\n<p> From 1993 until 2001, he was with
      McKinsey & Company, ultimately as a partner, and was involved in numerous projects
      with industrial, financial and technology firms in Europe, the US and Southeast
      Asia. In October 2002, he co-founded Swiss-based Spectrum Value Management Ltd,
      which administers the industrial and private investments of the family Thomas
      Schmidheiny.</p>\r\n<p> He joined Spectrum Value Management Ltd. as Managing
      Partner and at the beginning of 2006 he became CEO. In addition he serves as
      member of the Board of Holcim, Rieter, IHAG Holding and Grand Resort Bad Ragaz.
      In India he was a Board member of the Mumbai-based Edelweiss Capital.</p>\r\n\r\n<span>\r\n<b>Speaking
      at:</b>\r\n\r\nManaging family Wealth – Options and Strategies</span>"
