    - ! 'Mr. Gopal Srinivasan : Chairman & Managing Director, TVS Capital Funds Ltd '
    - ! "<p><b>Gopal</b>, a member of the TVS family, is the Chairman & Managing Director
      of TVS Capital Funds Limited, a PE fund to develop and nurture India’s mid-cap
      businesses into world-class companies. Gopal, a commerce graduate from Loyola
      College, Chennai and an MBA from University of Michigan, USA, founded TVS Electronics
      Limited. He continues to be its Chairman and is a Director in TVS & Sons Ltd
      and other group companies.</p>\r\n\r\n<p>Gopal was the Chairman of the “Confederation
      of Indian Industry (CII)” Tamil Nadu State Council for the year ‘07-‘08. He
      was also the Chairman of CII National Committee for Private Equity & Venture
      Capital for 2010-11. Gopal had also been a Board member in Great Lakes Institute
      of Management.</p>\r\n\r\n<p>Gopal, a passionate entrepreneur, has incubated
      many businesses and has over twenty five years of experience in the field of
      business. He is associated with Chennai Angels and The Indus Entrepreneurs (TiE)
      where he provides guidance to the budding entrepreneurs on incubating businesses.</p>\r\n\r\n<span><b>Speaking
      at:</b>\r\n\r\nManaging family Wealth – Options and Strategies</span>"
