    - ! 'Mr. Harsh C Mariwala : Chairman & Managing Director, Marico Limited'
    - ! "<p><b>Mr. Harsh Mariwala</b>leads Marico Limited (Marico) as its Chairman
      and Managing Director. Over the last 3 decades, Mr. Mariwala has transformed
      a traditional commodity driven business into a leading Consumer Products & Services
      Company, in the Beauty and Wellness space. From a turnover of Rs.50 Lakhs in
      1971, Marico's Products and Services in Hair Care, Skin Care and Healthy Foods
      generated a turnover of about Rs. 4008 crores during 2011-12. Marico markets
      well-known brands such as Parachute, Saffola, Kaya, Mediker, Revive, among others.</p>\r\n\r\n<p>Being
      passionate about innovation, Mr. Mariwala founded the Marico Innovation Foundation
      in 2003. He has recently launched ASCENT - an initiative to help budding entrepreneurs
      in scaling-up their business. He has been the President of Federation of Indian
      Chambers of Commerce and Industry (FICCI) for the year 2011 – 2012.</p>\r\n\r\n<p>Mr.
      Mariwala has received several prestigious awards and recognitions including
      the NDTV Profit Business Leadership Award 2009, Ernst & Young Entrepreneur of
      the Year Award 2009 and India Talent Management Award at the CNBC TV18 India
      Business Leader Awards 2009.</p>\r\n\r\n<span><b>Speaking at:</b>\r\n\r\nSustaining
