    - ! 'Ms. Meher Pudumjee : Chairperson – Thermax Limited'
    - ! "<p><b>Meher Pudumjee</b> is the Chairperson of Thermax Ltd, a company focussed
      in the businesses of energy and the environment.\r\n\r\nA postgraduate in Chemical
      Engineering from the Imperial College of Science & Technology, London, Meher
      joined Thermax as a trainee engineer in August 1990.</p>\r\n\r\n<p>A year later,
      along with her husband Pheroz Pudumjee, she took over the responsibility of
      managing the Thermax subsidiary company in the UK.\r\n\r\nAfter her return to
      India in September 1996, she was appointed on the Board of Directors. With her
      newly acquired interest in Finance, she worked closely with the treasury and
      working capital management functions of Thermax.</p>\r\n\r\n<p>In January 2001
      she became a non-executive director and was appointed Vice Chairperson in 2002.
      During this period she played an active role in the turnaround of the company,
      alongwith the senior management of the company.\r\n\r\nShe has taken over as
      Chairperson, Thermax Limited, effective October 5, 2004, after the retirement
      of Mrs. Anu Aga.</p>\r\n\r\n<span><b>Speaking at:</b>\r\n\r\nProfessionalisation,
