    - ! 'Mr. Mohan Reddy BVR : Chairman and Managing Director, Infotech Enterprises
      Ltd '
    - ! "<p><b>Mr BVR Mohan Reddy </b>is the Chairman and Managing Director of Infotech
      Enterprises Ltd. After successful stints with some big corporates in India,
      he established Infotech in 1991. Infotech is now a US $324 million IT company
      that employs more than 10000 professionals who operate from its 30 locations
      across the globe. An alumnus of IIT Kanpur and University of Michigan, Mr Reddy
      has around thirty years of Engineering and Management Experience. </p>\r\n    <p>He
      is a member of the Executive Council of NASSCOM since 2003. He is actively involved
      with the Confederation of Indian Industry (CII) and serves on its various Councils.
      He was the Chairman of CII’s AP State Council during 2002-2003 and the Southern
      Region during 2008-09. He also serves on councils of various academic and industry
      related forums.</p>\r\n\r\n<p>Mr. Reddy currently serves as the Chairman of
      Board of Governors of IIT Hyderabad. He was conferred honorary degree of Doctor
      of Philosophy by Jawaharlal Nehru Technological University (JNTU), Hyderabad.
      IIT, Kanpur has recognized Mr. Reddy with the Distinguished Alumni Award (DAA).
      ASME (American Society of Mechanical Engineers) conferred him with CIE Leadership
      Award for 2011. He has been awarded “India Geospatial Leadership Award” at India
      Geospatial Forum 2012 in recognition of his pioneering efforts in this area
      of business.</p>\r\n\r\n<span><b>Speaking at:</b>\r\n\r\nProfessionalisation,
