    - ! 'Mr. Peter Leach : Founder and Chairman, Peter Leach & Partners LLP, London'
    - ! "<p><b>Peter Leach</b> is the Founder and Chairman of Peter Leach & Partners
      LLP, an advisory firm for entrepreneurial families. With over 30 years of experience
      as a business advisor, teacher and facilitator working with family business
      owners internationally, he is seen as the \"founding father\" of family business
      thinking in the UK. </p>\r\n\r\n<p>Peter specializes in working with multi-generational
      family businesses on governance issues. Peter is author of ‘Family Businesses:
      The Essentials,’ and has written a number of other books on the subject. Peter
      holds the post of Adjunct Professor in Family Business at Imperial College London.</p>\r\n\r\n
      <p>A much sought after speaker, Peter lectures at business schools and universities
      all over the world and is frequently quoted in the British and international
      press. He has addressed a wide range of organisations on the significance and
      contribution of the family business sector, including the CBI and the European
      Commission.</p>\r\n\r\n<p>He is the Chairman of the Advisory Board of the UK
      Institute for Family Business, and is a Fellow of the Family Firm Institute
      of the USA. He is also a Fellow of the Institute of Chartered Accountants in
      England and Wales, having previously been a senior partner at BDO, one of the
      world’s largest accountancy firms for 25 years. Peter currently sits as a Non-Executive
      Director on the Board of Pentland Group Plc, a well-known UK family business.</p>\r\n\r\n<p>Peter
      was awarded the Family Business Place Red Ribbon Award in 2010, for his outstanding
      contribution to the field of Family Business. Peter was also awarded the Richard
      Beckhard Award in 2011, by the Family Firm Institute, USA.</p>\r\n\r\n<span><b>Speaking
      at:</b>\r\n\r\nBuilding Institutions : Role of Family and Business Governance</span>"
