    - ! 'Prof. Ramachandran Kavil : Thomas Schmidheiny Chair Professor of Family Business
      and Wealth Management, ISB '
    - ! "<p><b>Professor Ram</b> is the Thomas Schmidheiny Chair Professor of Family
      Business and Wealth Management at the Indian School of Business. He has specialized
      in family business, entrepreneurship and strategy and has over 33 years of experience
      as an academic. He obtained a Ph.D. from the Cranfield School of Management,
      UK in 1986 on a comparative study of the small enterprise policies of Japan,
      UK and India. </p>\r\n  <p>  He has done research on family business, entrepreneurship
      and strategy, and has authored/edited six books and published extensively in
      reputed Indian and overseas journals. His consulting experience includes areas
      such as family business governance, professionalization, succession planning,
      strategic planning, and identification of new opportunities for growth, corporate
      entrepreneurship and turn around strategies in family and non-family environments.
      </p>\r\n    <p>He has written several management cases, and has conducted training
      programmes for family businesses on governance, professionalization, strategic
      management and entrepreneurship. He has been associated with the FBN International
      for several years, and has served on various advisory committees of the Government
      of India, World Bank, Securities and Exchange Board of India.</p>\r\n\r\n<span><b>Speaking
      at:</b>\r\n\r\nISB and Family Business.\r\nFamily Business in India – findings
      from recent research.\r\nManaging family Wealth – Options and Strategies.\r\n‘We’
      in the Family and Business.</span>"
