    - ! 'Prof. Ramnarayan S : Clinical Professor, Indian School of Business'
    - ! "<p><b>Dr. Ramnarayan S (Ram)</b> is Clinical Professor at the Indian School
      of Business (ISB). After his engineering and MBA, Ram earned his Ph.D. in Organizational
      Behavior from the Case Western Reserve University, Cleveland, Ohio.</p>\r\n\r\n<p>After
      initial years in industry, he has been a faculty at the Tata Management Training
      Centre, Pune for 5 years, and later Professor at Indian Institute of Management,
      Ahmedabad for 13 years. He has been visiting faculty at the Case Western Reserve
      University for a year and Guest Professor at the University of Bamberg, Germany
      for close to two years.</p>\r\n\r\n<p>He has helped several organizations in
      the areas of change, leadership and organization development. He has carried
      out research funded by Ford Foundation, World Bank, Commonwealth Secretariat,
      Department for International Development, Human Capital Leadership Institute
      and German Science Foundation. He has served on the Boards of business organizations
      and educational and social service institutions, and has received awards from
      leading professional bodies for his contributions.</p>\r\n\r\n<p>Apart from
      research papers, monographs and case studies, Ram has co-authored books on “Managing
      Organizational Change”, “Changing Tracks: Reinventing the Spirit of Indian Railways”,
      and “Change Management: Altering Mindsets in a Global Context” and co-edited
      books titled “Organization Development: Accelerating Learning and Transformation”,
      “Life After 360 Degree Feedback”, “Strategic Management of Public Enterprises
      in Developing Countries”, and “Managerial Dilemmas: Cases in Organizational
      Behavior”.</p>\r\n\r\n<span><b>Speaking at:</b>\r\n\r\n‘We’ in the Family and
      Business</span>"
    - Ram1.jpg
    - image/jpeg
    - 7943
    - '2013-01-29 03:50:40.589462'
