    - ! 'Prof. Raveendra Chittoor : Assistant Professor of Strategy, Indian School
      of Business '
    - ! "<p><b>Raveendra Chittoor</b> is an Assistant Professor of Strategy at the
      Indian School of Business. His research focuses on the internationalisation
      strategies of emerging economy firms and the structure and strategies of family
      business groups in India. Prof. Chittoor’s current research is aimed at understanding
      how Indian family business groups create value in the firms affiliated to them.
      </p>\r\n    <p>Prof. Chittoor has also been spearheading a joint effort by the
      ISB and Fundacao Dom Cabrall (FDC, a leading business school in Brazil) to systematically
      rank Indian transnational companies annually using globally accepted, multi-dimensional
      measures of internationalization. Prof. Chittoor is a recipient of several awards
      for his research.</p>\r\n\r\n<p>Prof. Chittoor is a management graduate from
      the Indian Institute of Management, Ahmedabad and a doctorate from the Indian
      Institute of Management Calcutta. Prior to joining the ISB, he has taught at
      Indian Institute of Management Calcutta and has industry experience of over
      twelve years in organizations such as IBM, CRISIL and Mumbai-based Rajan Raheja
      group. Prof. Chittoor teaches the core competitive strategy course at the ISB
      and elective courses on strategy implementation and global strategy.</p>\r\n\r\n<span><b>Speaking
      at:</b>\r\n\r\nFamily Enterpreneurship</span>"
    - RaveedraChitoor.jpg
