    - ! 'Rohtash Mal : Chairman, Equitigro '
    - ! "<p>With over 35 years of experience across various family owned businesses
      in varied industries like Telecom, Automobiles, Paper, Chemicals and Agri-Machinery,
      he is the Chairman of the recently founded Equitigro Ventures. <b>Mr. Mal</b>
      is a known organization builder, having led two large turnarounds and four start-ups.</p>\r\n\r\n<p>An
      alumnus of IIT Delhi and IIM Calcutta, Mr. Mal has worked in leadership positions
      of family held businesses and regarded a turnaround expert. Prior to setting
      up Equitigro Ventures, Mr. Mal was the Executive Director & CEO of Escorts Limited.
      He has been in CEO/CXO positions with companies like Bharti Airtel, Maruti Suzuki
      and Ballarpur Industries Limited taking them to significant growth trajectories
      during his tenure.</p>\r\n\r\n<p>A mentor and angel investor, Mr. Mal also represents
      Silicon Valleys’ Khosla Ventures at Moksha Yug Access and Driptech in India.
      He is a member of the Executive Advisory Committee of Simon Business School,
      University of Rochester,and actively involves himself in various committees
      of the Confederation of Indian Industry .</p>\r\n\r\n<p>In the past, he has
      held leadership positions of Executive Director & CEO at Escorts Limited, CEO
      of Bharti FieldFresh Limited and Bharti Airtel Ltd. Earlier, he was Chief General
      Manager at Maruti Suzuki Ltd and Senior Vice President at Ballarpur Industries
      Limited. He has also been the President of Tractor Manufacturers Association.</p>\r\n<span><b>Speaking
      at:</b>\r\n\r\nProfessionalisation, Professionalism and Governance<span>"
    - RohtashMal.jpg
