    - ! 'Mr. Sharad D Amalean : Deputy Chairman, MAS Holdings, Srilanka '
    - ! "<p><b>Mr. Sharad </b>is the Deputy Chairman of MAS Holdings, an apparel business
      that he founded with his brothers in 1986. Since its inception MAS Holdings
      has grown to become the region’s largest provider of end to end apparel solutions
      for intimate & sports brands such as Victoria’s Secret, Triumph, GAP, Marks
      & Spencer, Nike, adidas. In the recent past the company has diversified into
      Information Technology, Brands & Industrial real estate.</p>\r\n\r\n<p>Mr. Sharad
      played the crucial role of nurturing Joint ventures & strategic relationships
      that have been instrumental to the exponential growth of MAS Holdings.</p>\r\n\r\n<p>Born
      in a business family, Mr. Sharad graduated from Royal College, Colombo and attended
      executive programmes at Kellogg, INSEAD and Wharton Business Schools.</p>\r\n\r\n<span><b>Speaking
      at:</b>\r\n\r\nFamily Harmony</span>"
