    - ! 'Ms. Shobana Kamineni : Executive Director – New Initiatives, Apollo Hospitals
      Enterprise Limited'
    - ! "<p><b>Shobana</b> heads the new initiatives of Apollo Hospitals that was
      founded by her father Dr. Prathap C Reddy. She formally joined Apollo Hospitals,
      in 1982 as a liaison and project executive. She has been instrumental in catalyzing
      several of Apollo’s ambitious projects. An institution of trust and clinical
      excellence, today Apollo touches and impacts millions of lives across 120 countries.</p>\r\n\r\n<p>As
      Executive Director – New Initiatives she is not only involved in visualizing
      the project blueprint but also execution of these mega projects, down to the
      last detail. Ms. Shobana Kamineni spearheads Apollo Pharmacy - India’s largest
      pharma retailer with over 1500 pharmacies across India. In 2008 she headed Apollo’s
      foray into Health Insurance - Apollo Munich Health Insurance. Shobana nurtured
      Apollo Health Education and Research Foundation’s emergence as a milestone institution
      in cutting-edge clinical research in the region. She helped steer the Group
      to promote ‘BILLION HEARTS BEATING’ an NGO dedicated to educate and inform Indians
      on how to prevent heart disease.</p>\r\n\r\n<p>An active member of the Confederation
      of Indian Industry (CII), Ms. Kamineni was the Chairperson of CII (Southern
      Region), Chairperson CII-AP and chaired the CII National Committee on Entrepreneurship.
      She continues to be a member of the CII National Council.</p>\r\n\r\n<p>Shobana
      has been nominated as the Member of Executive Council & Finance Committee of
      Osmania University, Hyderabad. She is also Vice-Chairperson of the KEI Group
      that has interests in sectors like Energy, Pharma and Theme Parks.</p>\r\n\r\n<p>Shobana
      received her Bachelor of Arts degree in Economics from the Stella Maris College,
      Chennai and has an accelerated Hospital Administration Diploma from Columbia
      University, New York. She has always been an avid sportsperson and was a national
      level squash player. </p>\r\n\r\n<span><b>Speaking at:</b>\r\n\r\nFamily Harmony</span>"
    - Shobana1.jpg
