    - ! 'Mr. Sunil Kant Munjal : Jt Managing Director – Hero Moto Corp Limited, Chairman  -
      Hero Corporate Service Limited '
    - ! "<p><b>Sunil Kant Munjal</b> is a senior member of the $ 5.1 billion plus
      Hero Group and is responsible for developing growth strategy and implementation
      of new business plans for the Group. He is the Joint Managing Director of Hero
      MotoCorp and sits on the boards of a large number of Hero Group companies.\r\n\r\n<p>Munjal
      is also on the boards of DCM Shriram Consolidated, the Coca Cola India Advisory
      Board and the Bharti Foundation, the social service arm of Airtel. He is on
      the board of the Indian School of Business. He is a member of the Board of Governors
      of IIT, Ropar in Punjab. He also serves on the President’s Council at the University
      of Tokyo, Japan.\r\nHe was selected by ‘India Today’ magazine as one of the
      “Faces of the Millennium” for business. He has received GlobScot Award from
      the Scottish Government in Sept., 2012. He has been appointed as Chairman of
      the Board of Governors of Punjab Technical University, Jalandhar by the Punjab
      Govt. in October, 2012. In the past, Mr. Munjal has been on the boards of Life
      Insurance Corporation of India Ltd, and PNB Gilts Ltd. Mr. Munjal was President
      of Confederation of Indian Industry (CII) for the year 2004-05.</p>\r\n\r\n<p>Munjal
      is currently a member of Prime Minister’s Council on Trade & Industry. He has
      been a member of noted committees like the Narasimham Committee (banking and
      financial sector reforms), Kelkar Committee (reforms in indirect taxes), Northern
      Regional Advisory Committee of The Industrial Development Bank of India and
      consultative groups on industry and external sector set up by the Planning Commission.
      He also chaired the Study Group on Skill Development, Training and Workers’
      Education, constituted under the Second National Commission on Labour Reforms.\r\nIn
      addition, Munjal is involved in a number of other social and philanthropic activities.</p>\r\n\r\n<span><b>Speaking
      at:</b>\r\n\r\n‘We’ in the Family and Business</span>"
    - SunilKant.jpg
