    - ! 'Mr. Thomas Schmidheiny : Founder & Chairman, Spectrum Value Management Ltd,
      Zurich '
    - ! "<p>Swiss, born 1945. <b>Thomas Schmidheiny</b> is chairman and founder of
      his family office Spectrum Value Management. Spectrum manages the investments
      of the Schmidheiny family.</p>\r\n\r\n<p>After studying mechanical engineering
      at the Swiss Federal Institute of Technology in Zurich (ETHZ), Dr h.c. Schmidheiny
      began his career as Technical Director with Cementos Apasco (1970-1971). In
      1973 he joined “Holderbank” Financière Glaris Ltd. (which became Holcim), where
      he served as Managing Director and Chairman (1978-2001) and Chairman of the
      Board (1984-2003). He continues to be a member of the Holcim Board of Directors,
      and is member of the Holcim Governance, Nomination & Compensation Committee.
      He is a principal stockholder of Holcim.\r\nDr h.c. Schmidheiny is also a board
      member and major shareholder of the Grand Resort Bad Ragaz and Chairman of the
      Ernst Schmidheiny Foundation for public education, amongst others. He received
      an honorary Doctorate of Business Administration from Tufts University (USA)
      and holds an MBA from IMD. His particular interest is philanthropy: he engages
      in large donations and sponsoring to business schools, arts, education and start-ups
      through his foundations.</p>\r\n\r\n<span><b>Speaking at:</b>\r\n\r\nISB & Family
      Business</span>"
    - ThomasS.jpg
    - image/jpeg
    - 7611
    - '2013-01-29 03:59:56.419493'

